        $twitter_new = array();
        
        foreach ($twitter as $idx => $user)
        {
            $id_token = explode('-', $user['token']);
            
            $twitter_new[$idx]['tw_userid'] = $id_token[0];
            $twitter_new[$idx]['tw_token'] = $user['token'];
            $twitter_new[$idx]['tw_secret'] = $user['secret'];
            $twitter_new[$idx]['tw_screenname'] = $user['username'];
            $twitter_new[$idx]['timing'] = 'WaitForPlayCount';
            $twitter_new[$idx]['timing_value'] = 10;
            $twitter_new[$idx]['prefix'] = $user['prefix'];
            $twitter_new[$idx]['postfix'] = $user['postfix'];
            $twitter_new[$idx]['songtypes'] = 'S';
            
            $retrieve = elements(array
            (
                'tw_userid',
                'tw_token',
                'tw_secret',
                'tw_screenname',
            ), $twitter_new[$idx]);
           
            try {
                $this->twitter_model->twitter_retrieve('settings', $retrieve);    
            }
            catch (Exception $e)
            {
                echo $idx."\n<br />";
                continue;
            }
            

            $keys = array
            (
                'ID',
                'token',
                'secret',
                'screenname',
                'timing',
                'timing_value',
                'prefix',
                'postfix',
                'songtypes',
            );
            
            $this->twitter_model->twitter_update(array_combine($keys, $twitter_new[$idx]), $twitter_new[$idx]['tw_userid']);
        }       
        echo "Processed ".$idx." entries.";
